import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom';
import App from './App';
import './index.css';

const routing = (
  <BrowserRouter>  
      <App />
  </BrowserRouter>
)

ReactDOM.render(routing, document.getElementById('root'));
